# NOTE: Keys are used to dynamically generate error classes.
AccessOfSelfAsProperty:                所有変数と同じ名前の属性をアクセス出来ない（%s）。
AssignmentToReadOnlyProperty:          読み取り専用属性に代入出来ない（%s）。
AssignmentToValue:                     プリミティブ値に代入出来ない（%s）。
EmptyOrUnclosedInterpolation:          空または終了してない文字列補間（%s）。
ExperimentalFeature:                   この機能は準備中（%s）。
FunctionDefAlreadyDeclared:            関数名（%s）は既に宣言している。
FunctionDefAmbiguousConjugation:       関数名（%s）の活用は既に宣言した関数名と競合する。「!」または「！」を最後に付けると既存の関数の活用を上書きする。
FunctionDefDuplicateParameters:        関数定義に同じ引数名が二回使用してる。
FunctionDefNonVerbName:                関数名が動詞ではない（%s）。
FunctionDefPrimitiveParameters:        プリミティブ値の引数の関数を宣言出来ない。
FunctionDefReserved:                   予約の関数名を宣言出来ない（%s）。
FunctionNameAlreadyDelcaredAsVariable: 既に宣言した変数名を関数として宣言出来ない（%s）。
InvalidLogParameterParticle:           対数計算における不正な引数の助詞（%s）。
InvalidLoopParameter:                  不正な反復の引数（%s）。
InvalidLoopParameterParticle:          不正な反復の引数の助詞（%s）。
InvalidProperty:                       不正な属性（%s）。
InvalidPropertyOwner:                  不正な属性の所有変数（%s）。
InvalidReturnParameterParticle:        不正な復帰の引数の助詞（%s）。もしかして「%s」？
InvalidSubstitution:                   不正な補間（%s）。文字列補間に使用可能なのは変数または属性のみ。
MalformedString:                       無効な文字列（%s）。
NotANumericParameter:                  数値型の引数ではない（%s）。
NotAValidContainer:                    有効なコンテナーではない（%s）。
PropertyDoesNotExist:                  属性は存在しない（%s）。
UnclosedBlockComment:                  終了してないブロックコメント。
UnclosedString:                        終了してない文字列（%s）。
UnexpectedElse:                        予期しない「else（または）」。
UnexpectedElseIf:                      予期しない「else-if（もしくは〇〇）」。
UnexpectedEof:                         予期しないEOF（ファイル終了）。
UnexpectedFunctionDef:                 予期しない関数定義（%s）。
UnexpectedIndent:                      予期しないインデント段階。予期： %s　実際： %s 。
UnexpectedInput:                       予期しない入力（%s）。
UnexpectedLineBreak:                   予期しない改行（\）。
UnexpectedQuestion:                    "%sの後に予期しないはてなマーク。"
UnexpectedReturn:                      予期しない復帰（%s）。
UnexpectedScope:                       予期しないスコープ。予期： %s　実際： %s 。
VariableDoesNotExist:                  変数は存在しない（%s）。
VariableNameAlreadyDelcaredAsFunction: 既に宣言した関数名を変数として宣言出来ない（%s）。
VariableNameIllegalCharacters:         無効な文字を含む変数名は宣言出来ない（%s）。
VariableNameReserved:                  予約の変数名を宣言出来ない（%s）。
